import React from "react";

export const CreateModelPage =() => {
    return (
        <div>
            <div className="input-field col s12 m6">
                <select>
                    <option value="" disabled selected>Кол-во альтернатив</option>
                    <option value='1'> Option 1</option>
                </select>
            </div>
        </div>
    )
}
